package aop.service.impl;import aop.domain.ResponseLogs;import aop.mapper.ResponseLogsMapper;import aop.service.IResponseLogsService;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;@Servicepublic class ResponseLogsServiceImpl implements IResponseLogsService {    @Autowired    private ResponseLogsMapper responseLogsMapper;    public int insertResponseLogs(ResponseLogs responseLogs){        return responseLogsMapper.insertResponseLogs(responseLogs);    }}